                if(user){
                    user = JSON.parse(user);
                    console.log(user);
                }
                else{
                    console.log("帐号或密码错误")
                }
                
            },
            error() {
                
            }
        })
    }
    render() {
        return (
            <div>
                <button onClick={this.login.bind(this)}>on </button>
           <TarbarS></TarbarS>
            </div>
        )
